import React, { Component } from 'react';
import API from '../../backend/API';

class Home extends Component{
  state = {
    stations: []
  };

  componentDidMount(){
    usageAPI.get().then(result =>
      this.setState(() => ({
        stations: result
      }))
    );
    console.log(this.state.stations);
  }

  render(){
    return(
      <div>
        <h3>Home View</h3>
      </div>
    )
  }
};

export default Home;
